import ReactDOM from "react-dom/client";
import "./index.css";

const fname = "Kenil";
const lname = "Finaviya";

console.log(`My name is ${fname + { lname }} `);

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <>
    <h1>My name is {fname + " " + lname}.</h1>
  </>
